from typing import List
import sys



# Node creation
class Node():

    def __init__(self, key: int) -> None:
        self.key = key
        self.parent = None
        self.left = None
        self.right = None
        self._color = 1


    def get_color(self) -> str:
        return self._color

    def set_color(self, color) -> None:
        self._color = color
   

    def is_red(self) -> bool:
        return self._color == 1

    def is_black(self) -> bool:
        return self._color == 0

    def is_null(self) -> bool:
        return self.key is None


    @classmethod
    def null(cls):
        node = cls(0)
        node.key = None
        node.set_color(0)
        return node



class RedBlackTree():
    def __init__(self) -> None:
        self.TNULL = Node.null()
        self.root = self.TNULL
        self.size = 0
        self._iter_format = 0
        self.max = 0


    # Balancing the tree after deletion
    def delete_fix(self, x: Node) -> None:
        while x != self.root and x.is_black():
            if x == x.parent.left:
                s = x.parent.right
                if s.is_red():
                    s.set_color(0)
                    x.parent.set_color(1)
                    self.left_rotate(x.parent)
                    s = x.parent.right

                if s.left.is_black() and s.right.is_black():
                    s.set_color(1)
                    x = x.parent
                else:
                    if s.right.is_black():
                        s.left.set_color(0)
                        s.set_color(1)
                        self.right_rotate(s)
                        s = x.parent.right

                    s.set_color(x.parent.get_color())
                    x.parent.set_color(0)
                    s.right.set_color(0)
                    self.left_rotate(x.parent)
                    x = self.root
            else:
                s = x.parent.left
                if s.is_red():
                    s.set_color(0)
                    x.parent.set_color(1)
                    self.right_rotate(x.parent)
                    s = x.parent.left

                if s.left.is_black() and s.right.is_black():
                    s.set_color(1)
                    x = x.parent
                else:
                    if s.left.is_black():
                        s.right.set_color(0)
                        s.set_color(1)
                        self.left_rotate(s)
                        s = x.parent.left

                    s.set_color(x.parent.get_color())
                    x.parent.set_color(0)
                    s.left.set_color(0)
                    self.right_rotate(x.parent)
                    x = self.root
        x.set_color(0)

    def __rb_transplant(self, u: Node, v: Node) -> None:
        if u.parent is None:
            self.root = v
        elif u == u.parent.left:
            u.parent.left = v
        else:
            u.parent.right = v
        v.parent = u.parent

    # Node deletion
    def delete_node_helper(self, node: Node, key: int) -> None:
        z = self.TNULL
        while not node.is_null():
            if node.key == key:
                z = node

            if node.key <= key:
                node = node.right
            else:
                node = node.left

        if z.is_null():
            # print("Cannot find key in the tree")
            return

        y = z

        if z.key == self.max:
            if not z.right.is_null():
                self.max = z.right.key
            elif not z.left.is_null():
                self.max = z.left.key
            elif not z.parent is None:
                self.max = z.parent.key
            else:
                self.max = 0

        y_original_color = y.get_color()
        if z.left.is_null():
            # If no left child, just scoot the right subtree up
            x = z.right
            self.__rb_transplant(z, z.right)
        elif (z.right.is_null()):
            # If no right child, just scoot the left subtree up
            x = z.left
            self.__rb_transplant(z, z.left)
        else:
            y = self.minimum(z.right)
            y_original_color = y.get_color()
            x = y.right
            if y.parent == z:
                x.parent = y
            else:
                self.__rb_transplant(y, y.right)
                y.right = z.right
                y.right.parent = y

            self.__rb_transplant(z, y)
            y.left = z.left
            y.left.parent = y
            y.set_color(z.get_color())
        if y_original_color == 0:
            self.delete_fix(x)

        self.size -= 1

    # Balance the tree after insertion
    def fix_insert(self, node: Node) -> None:
        while node.parent.is_red():
            if node.parent == node.parent.parent.right:
                u = node.parent.parent.left
                if u.is_red():
                    u.set_color(0)
                    node.parent.set_color(0)
                    node.parent.parent.set_color(1)
                    node = node.parent.parent
                else:
                    if node == node.parent.left:
                        node = node.parent
                        self.right_rotate(node)
                    node.parent.set_color(0)
                    node.parent.parent.set_color(1)
                    self.left_rotate(node.parent.parent)
            else:
                u = node.parent.parent.right

                if u.is_red():
                    u.set_color(0)
                    node.parent.set_color(0)
                    node.parent.parent.set_color(1)
                    node = node.parent.parent
                else:
                    if node == node.parent.right:
                        node = node.parent
                        self.left_rotate(node)
                    node.parent.set_color(0)
                    node.parent.parent.set_color(1)
                    self.right_rotate(node.parent.parent)
            if node == self.root:
                break
        self.root.set_color(0)

    # Printing the tree
    def __print_helper(self, node: Node, indent: str, last: bool) -> None:
        if not node.is_null():
            sys.stdout.write(indent)
            if last:
                sys.stdout.write("R----  ")
                indent += "     "
            else:
                sys.stdout.write("L----   ")
                indent += "|    "

            s_color = 1 if node.is_red() else 0
            print(str(node.key) + "(" + s_color + ")")
            self.__print_helper(node.left, indent, False)
            self.__print_helper(node.right, indent, True)


    def minimum(self, node: Node = None) -> Node:
        if node is None:
            node = self.root
        if node.is_null():
            return self.TNULL
        while not node.left.is_null():
            node = node.left
        return node


    def left_rotate(self, x: Node) -> None:
        y = x.right
        x.right = y.left
        if not y.left.is_null():
            y.left.parent = x

        y.parent = x.parent
        if x.parent is None:
            self.root = y
        elif x == x.parent.left:
            x.parent.left = y
        else:
            x.parent.right = y
        y.left = x
        x.parent = y

    def right_rotate(self, x: Node) -> None:
        y = x.left
        x.left = y.right
        if not y.right.is_null():
            y.right.parent = x

        y.parent = x.parent
        if x.parent is None:
            self.root = y
        elif x == x.parent.right:
            x.parent.right = y
        else:
            x.parent.left = y
        y.right = x
        x.parent = y

    def insert(self, key: int) -> None:
        if key > self.max:
            self.max = key

        node = Node(key)
        node.left = self.TNULL
        node.right = self.TNULL
        node.set_color(1)

        y = None
        x = self.root

        while not x.is_null():
            y = x
            if node.key < x.key:
                x = x.left
            else:
                x = x.right

        node.parent = y
        if y is None:
            self.root = node
        elif node.key < y.key:
            y.left = node
        else:
            y.right = node

        self.size += 1

        if node.parent is None:
            node.set_color(0)
            return

        if node.parent.parent is None:
            return

        self.fix_insert(node)

    def delete(self, key: int) -> None:
        self.delete_node_helper(self.root, key)

    def print_tree(self) -> None:
        self.__print_helper(self.root, "", True)

  




def batiments(n: int, r: int, k: int, villes: List[int]) -> None:
    """
    :param n: le nombre de villes
    :param r: le nombre de mouvements du serpent
    :param k: le nombre de villes impliquées dans chaque mouvement
    :param villes: le nombre de bâtiments cassés dans chaque ville
    """
    # TODO Afficher le nombre de bâtiments cassés à chaque ville après les $R$
    # mouvements sous la forme d'une suite d'entiers séparés par des espaces.
    insert= 0
    delete = 0

    villes_final = [0 for i in range(n)]
    tree = RedBlackTree()
    for i in range(1+((r-1)//n+1) * (k-1)):
        insert+=1
        tree.insert(villes[i])
    
    villes_final[0] = tree.max

    for i in range(1,n):
        delete+=1
        tree.delete(villes[i-1])
        for a in range((i-1)+1+((r-(i-1)-1)//n+1) * (k-1), min(i+1+((r-i-1)//n+1) * (k-1),n)):
            insert+=1
            tree.insert(villes[a])

        for a in range(i+1+((r-i-1)//n+1) * (k-1), min((i-1)+1+((r-(i-1)-1)//n+1) * (k-1),n)):
            delete+=1
            tree.delete(villes[a])


        if i+1+((r-i-1)//n+1) * (k-1) > n:
            
            for a in range(0, (i+1+((r-i-1)//n+2) * (k-1)) % n):
                insert+=1
                tree.insert(villes[a])

        villes_final[i] = tree.max

    del tree
    # print(" ".join(list(map(str, villes_final))))
    # print("insert", insert, "delete", delete)
    return villes_final


def batiments2(n: int, r: int, k: int, villes: List[int]) -> None:
    """
    :param n: le nombre de villes
    :param r: le nombre de mouvements du serpent
    :param k: le nombre de villes impliquées dans chaque mouvement
    :param villes: le nombre de bâtiments cassés dans chaque ville
    """
    # TODO Afficher le nombre de bâtiments cassés à chaque ville après les $R$
    # mouvements sous la forme d'une suite d'entiers séparés par des espaces.

    for i in range(r):
        # if i%n == 0:
        #     print(" ".join(list(map(str, villes))))

        indice = i % n
        villes[indice] = max(villes[i % n:i % n+k])
        if i % n+k > n:
            m = max(villes[0:(i % n+k) % n])

            if m > villes[indice]:
                villes[indice] = m

    # print(" ".join(list(map(str, villes))))
    return villes


